node.text:
"Vamos con la ilusión que todo argentino tiene" dijo @nicolasotamendi30 tras el empate de @afaselección🇦🇷 por 1 a 1 con @latriecu en las #Eliminatorias de #Qatar2022.

@juliaanalvarez abrió la cuenta para la albiceleste a los 24 minutos de la primera etapa. El combinado ecuatoriano estableció la igualdad, mediante un tanto de @ennervalencia1, a los 47 minutos del segundo tiempo.

El Mundial está cada vez más cerca y seguimos alentando a nuestra selección con #somosargentinas

En la última fecha de las #Eliminatorias de #Qatar2022 @afaselección🇦🇷 empató 1 a 1 con @latriecu en el estadio Monumental Banco Pichincha de Guayaquil.

@juliaanalvarez abrió la cuenta para la albiceleste a los 24 minutos de la primera etapa. El combinado ecuatoriano estableció la igualdad, mediante un tanto de @ennervalencia1, a los 47 minutos del segundo tiempo.

El Mundial está cada vez más cerca y seguimos alentando a nuestra selección con #somosargentinas
